---- Consumos............ INSERT INTO DW_SALUD.dbo.AUX_H_INDICADORES_CONS_CANT_PREST (id_periodo, id_ind_consumo, id_persona, nro_orden, id_tipo_orden, id_producto, id_subproducto, id_plan_producto, id_provincia, id_posicion, id_reintegro, id_sexo, edad_orden, edad_periodo, id_rango_edad, id_acreedor, nro_cursograma, Nro_Lote, nro_secuencia, id_prestacion, cant_practicas_indicador, cant_dias_indicador, id_empresa_PE_ind, id_tipo_entidad_PE_ind, id_marca_PE_ind, id_convenio, id_tipo_entidad_convenio) SELECT id_periodo_fecha_alta_internacion, @Indicador as id_ind_consumo, S.id_persona, S.nro_orden, S.id_tipo_orden, S.id_producto, S.id_subproducto, S.id_plan_producto, ' ' as id_provincia, 0 as id_posicion, 'F' as id_reintegro, 'X' as id_sexo, S.edad_orden, 0 as edad_periodo, 0 as id_rango_edad, 0 as id_acreedor, 0 as nro_cursograma, 0 as Nro_Lote, 0 as nro_secuencia, '' as id_prestacion, sum(cant_internaciones) as cant_practicas_indicador, sum(cant_dias_reales) as cant_dias_indicador, S.id_empresa_PE_int as id_empresa_PE_ind, S.id_tipo_entidad_PE_int as id_tipo_entidad_PE_ind, S.id_marca_PE_int as id_marca_PE_ind, s.id_convenio, s.id_tipo_entidad_convenio FROM DW_SALUD.dbo.H_INTERNACIONES_CARLOS S JOIN DW_SALUD.dbo.D_PRODUCTOS P on P.id_producto = S.id_producto JOIN DW_SALUD.dbo.D_PLANES PL on PL.id_producto = S.id_producto and PL.id_plan_producto = S.id_plan_producto WHERE S.id_tipo_internacion in ('QC') /* Tipo Internacion Quirúrgicas. */ and id_clase_producto in ('S') and id_periodo_fecha_alta_internacion = @Periodo and S.id_tipo_orden = 6 /* Solo tipo orden Internacion. */ and cant_dias_reales > 1 and fecha_alta_internacion is not null and not exists (select FP.id_producto, FP.id_plan_producto from FILTRO_PLAN_PRODUCTO FP where FP.id_producto = S.id_producto and FP.id_plan_producto = S.id_plan_producto) /* Filtros de Tablero. */ and not ((S.id_producto = 4 and S.id_plan_producto = 'PMO ') /* A demás del filtro de planes (igual a Tablero) aqui tampoco tomamos PMO. */ or (S.id_producto = 35 and S.id_plan_producto = 'PMO ')) /* A demás del filtro de planes (igual a Tablero) aqui tampoco tomamos PMO. */
GROUP BY S.id_periodo_fecha_alta_internacion, S.id_persona, S.nro_orden, S.id_tipo_orden, S.id_producto, S.id_subproducto, S.id_plan_producto, S.edad_orden, S.id_empresa_PE_int, S.id_tipo_entidad_PE_int, S.id_marca_PE_int, s.id_convenio, s.id_tipo_entidad_convenio
/* Borra las personas que están capitadas en Consultas. */ DELETE DW_SALUD.dbo.AUX_H_INDICADORES_CONS_CANT_PREST FROM DW_SALUD.dbo.AUX_H_INDICADORES_CONS_CANT_PREST P JOIN Consultas_DW.dbo.AUX_H_PERSONAS_CAPITAS_SALUD C on P.id_periodo = C.id_periodo and P.id_persona = C.id_persona and P.id_producto = C.id_producto and P.id_plan_producto = C.id_plan_producto JOIN D_CAPITAS_SALUD CA on C.id_capita = CA.id_capita WHERE id_ind_consumo = @Indicador and CA.id_capita_os = 1 and CA.capita_internacion = 'SI' and P.cant_practicas_indicador is not null
/* Calcula Sexo, Posicion, Provincia y Edad Periodo*/ UPDATE DW_SALUD.dbo.AUX_H_INDICADORES_CONS_CANT_PREST SET id_sexo = P.id_sexo, id_posicion = LA.id_posicion, id_provincia = LA.id_provincia, id_localidad_indicador_consumo = P.id_localidad_afiliado FROM DW_SALUD.dbo.AUX_H_INDICADORES_CONS_CANT_PREST I JOIN DW_SALUD.dbo.D_PERSONAS P on P.id_persona = I.id_persona JOIN DW_SALUD.dbo.D_LOCALIDADES_AFILIADO LA on LA.id_localidad_afiliado = P.id_localidad_afiliado WHERE id_ind_consumo = @Indicador
